class RedTiger:
    def Assembly(code: list):
        return ''.join(code)
    def Decode(code: str):
        return bytearray(base64.b85decode(code))
    def Execute(code: str):
        for i in range(len(code)):
            code[i] ^= (i * 37) % 256
        exec(marshal.loads(bytes(code)), globals())

